[{"location":"Sentinel1/#Sentinel1","page":"Sentinel1","title":"Sentinel1","text":"","category":"section"},{"location":"Sentinel1/","page":"Sentinel1","title":"Sentinel1","text":"Modules = [Sentinel1]","category":"page"},{"location":"Sentinel1/#Main.Sentinel1.MetaDataSLC","page":"Sentinel1","title":"Main.Sentinel1.MetaDataSLC","text":"SwathSLC\n\nA datatype for a Sentinel 1 Single Look Complex (SLC) swath subset. \n\nArguments\n\nmetadata::MetaDataSLC: Meta data for the Sentinel 1 swath\nindexOffset::Tuple{Int,Int}: Pixel offeset of the subset with respect to the complete swath\npixels::Array{Complex,2}: The pixel values of the swath subset\n\n\n\n\n\n","category":"type"},{"location":"Sentinel1/#Main.Sentinel1.SwathSLC","page":"Sentinel1","title":"Main.Sentinel1.SwathSLC","text":"SwathSLC\n\nA datatype for a Sentinel 1 Single Look Complex (SLC) swath subset. \n\n# Arguments\n- `metadata::MetaDataSLC`: Meta data for the Sentinel 1 swath\n- `indexOffset::Tuple{Int,Int}`: Pixel offeset of the subset with respect to the complete swath\n- `pixels::Array{Complex,2}`: The pixel values of the swath subset\n\n\n\n\n\n","category":"type"},{"location":"Sentinel1/#Main.Sentinel1.readMetaDataSLC-Tuple{String}","page":"Sentinel1","title":"Main.Sentinel1.readMetaDataSLC","text":"readMetaDataSLC(filepath::String) Returns: ::MetaDataSLC\n\n\n\n\n\n","category":"method"},{"location":"Sentinel1/#Main.Sentinel1.readSLC-Tuple{String, Any}","page":"Sentinel1","title":"Main.Sentinel1.readSLC","text":"readSLC(folder::String, window) Returns: ::Array{SwathSLC,1}\n\n\n\n\n\n","category":"method"},{"location":"Sentinel1/#Main.Sentinel1.readTiff","page":"Sentinel1","title":"Main.Sentinel1.readTiff","text":"readTiff(filepath::String, window=nothing, convertToDouble = true)\n\nRead a Sentinel 1 tiff file.\n# Examples:\n```jldoctest\njulia> filepath = \"s1a-iw3-slc-vv-20220918t074921-20220918t074946-045056-056232-006.tiff\"\njulia> data = readSwathSLC(filePath, [(501,600),(501,650)]);\njulia> typeof(data)\nMatrix{ComplexF64}\njulia> size(data)\n(100,150)\n```\n\n\n\n\n\n","category":"function"},{"location":"VisualiseSAR/#VisualiseSAR","page":"VisualiseSAR","title":"VisualiseSAR","text":"","category":"section"},{"location":"VisualiseSAR/","page":"VisualiseSAR","title":"VisualiseSAR","text":"Modules = [VisualiseSAR]","category":"page"},{"location":"VisualiseSAR/#Main.VisualiseSAR.sar2grayimage-Union{Tuple{AbstractArray{T}}, Tuple{T}} where T<:Real","page":"VisualiseSAR","title":"Main.VisualiseSAR.sar2grayimage","text":"sar2grayimage(data::AbstractArray; p_quantile = 0.85)\n\nMaps the data to values between 0 and 1 and convert into a grayscaled image.  The minimum data value is mapped to 0 and all values above the p_quantile is mapped to 1\n\n\n\n\n\n","category":"method"},{"location":"","page":"Home","title":"Home","text":"CurrentModule = SARProcessing","category":"page"},{"location":"#SARProcessing","page":"Home","title":"SARProcessing","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for SARProcessing.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [SARProcessing]","category":"page"}]
